function BikeDetail({ bikes, id }) {
    const navigate = useNavigate()

    return (
        <Card sx={{ maxWidth: 325 }}
            className="car-card"
            onClick={() => navigate(`/bikes/${bikes.id}`)}>
            <CardContent>
                <img className="car-image" src={bikes.image} alt={bikes.name} />
                <div>
                    <Typography variant="h6" sx={{ fontSize: 16 }}>{bikes.price}</Typography>
                    <Typography color="text.primary" sx={{ fontSize: 14 }}>{bikes.model} - {bikes.kmDriven}</Typography>
                    <Typography variant="h6" sx={{ fontSize: 16 }}>{bikes.name}</Typography>
                    <Typography sx={{ fontSize: 14 }}>{bikes.location}</Typography>
                </div>
            </CardContent>
        </Card>
    )
}

export function BikeFeatures() {
    const navigate = useNavigate()
    const { id } = useParams();
    const [bikes, setBikes] = useState([])
    const token = localStorage.getItem('token');
    useEffect(() => {
        fetch(`http://localhost:27023/bikes/${id}`, {
            headers: {
                'x-auth-token': token,
            },
        })
            .then((data) => data.json())
            .then((dts) => setBikes(dts));
    }, [id]);
    return (
        <div className="bike-features">
            <div>
                <div className="bike-div">
                    <img className="bike-profile" src={bikes.image} alt={bikes.name} />
                </div>
                <Card sx={{ Width: 770, m: 2 }}>
                    <CardContent>
                        <Typography variant="h6" sx={{ fontSize: 25 }}>Details</Typography>
                        <div className="bike-flex">
                            <div>
                                <Typography>Brand </Typography>
                                <Typography>Year  </Typography>
                            </div>
                            <div>
                                <Typography>  {bikes.brand}</Typography>
                                <Typography>  {bikes.model}</Typography>
                            </div>
                            <div>
                                <Typography>Model  </Typography>
                                <Typography>KM driven  </Typography>
                            </div>
                            <div>
                                <Typography>  {bikes.name}</Typography>
                                <Typography> {bikes.kmDriven}</Typography>

                            </div>
                        </div>
                    </CardContent>
                </Card>
                <Card sx={{ Width: 770, m: 2 }}>
                    <CardContent>
                        <Typography variant="h6" sx={{ fontSize: 25 }}>Description</Typography>
                        <Typography color="text.primary">ABS : {bikes.ABS}</Typography>
                        <Typography color="text.primary">Accidental : {bikes.Accidental}</Typography>
                        <Typography color="text.primary">Battery Condition : {bikes.batteryCondition}</Typography>
                        <Typography color="text.primary">Insurance Type : {bikes.insuranceType}</Typography>
                        <Typography color="text.primary">Registration Place : {bikes.registration}</Typography>
                        <Typography color="text.primary">Tyre Condition : {bikes.tyreCondition}</Typography>

                        <Typography color="text.primary" sx={{ fontSize: 14 }}> Owner : {bikes.owner}</Typography >
                        <Typography color="text.primary" sx={{ fontSize: 14 }}> Location : {bikes.location} </Typography >
                        <Typography color="text.primary" sx={{ fontSize: 14 }}> <img src="https://statics.olx.in/olxin/buyers/items/v1/inspection/light/petrol_1x.svg" />  {bikes.type}</Typography >
                    </CardContent>
                </Card>
            </div>
            <div>
                <Card
                    sx={{ minWidth: 375, m: 2 }}
                    className="bikePriceCard">
                    <Typography variant="h6" sx={{ fontSize: 40, m: 1 }}>{bikes.price}</Typography>
                    <Typography color="text.primary" sx={{ fontSize: 14 }}>{bikes.model} - {bikes.kmDriven}</Typography>
                    <Typography variant="h6" sx={{ fontSize: 16 }}>{bikes.name}</Typography>
                    <Typography sx={{ fontSize: 14 }}>{bikes.location}</Typography>

                </Card>

                <Card
                    sx={{ minWidth: 375, m: 2 }}
                    className="bikeOwner">
                    <Typography variant="h6" sx={{ fontSize: 30, m: 1 }}>{bikes.ownerName}</Typography>
                    <Button sx={{ width: 375 }} color="primary" variant="outlined" onClick={() => navigate("/chat")}>Chat</Button>
                    <Typography sx={{ fontSize: 14, m: 1 }}><CallIcon fontSize="small" />{bikes.phoneNo}</Typography>

                </Card>
            </div>
        </div>
    )

}